/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";
import type UI5Element from "@ui5/webcomponents-base/dist/UI5Element.js";
import type SuggestionItemCustom from "../../SuggestionItemCustom.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: SuggestionItemCustom, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<li part="native-li" data-sap-focus-ref tabindex="${ifDefined(this._effectiveTabIndex)}" class="${classMap(this.classes.main as ClassMapValue)}" @focusin="${this._onfocusin}" @keyup="${this._onkeyup}" @keydown="${this._onkeydown}" draggable="${ifDefined(this.movable)}" @click="${this._onclick}" ><slot></slot></li> `;}


export default block0;
